import React from 'react';

import {Switch, Route} from "react-router-dom";

import Home from './Home';

import About from './About';

const App = () => {

  return(

    <>

      <Switch>

        <Route  exact to="/" component={<Home />} />

        <Route exact to="/about" component={<About />} />

      </Switch>

    </>

  );

};

export default App;
